ピンクの海賊  パイレーツ  コスプレ衣装  ハロウィン☆コスイチュームパイレーツ,衣装。ピンクのパフスリーブつきピンクと黒のドレス、レースとピンクのリボン付きパイレーツハット、ピンクのウェストスカーフ、黒のスリーブレット。ブーツは含まれておりません。<br><br>本商品は、海賊・パイレーツ（パイレーツ・オブ・カリビアン,ジャックス・パロウ,ジョニー・デップ,カリブの海賊等）の衣装・コスチューム、グッズとして、舞台やステージ衣装、ピアノなどの各種発表会衣装や各種行事やお遊戯会などにご利用ください。 Pink Punk Pirate Child3857<p><img src="http://www.rakuten.ne.jp/gold/acomes/images/common/schedule.png" alt="お届け予定日" border="0" />&nbsp;<img src="http://www.rakuten.ne.jp/gold/acomes/images/common/size.png" alt="サイズ表" border="0" /></p><BR><BR>*サイズのプルダウンメニューに詳細な記載がないサイズはサイズ表をご覧下さい。<BR>*モバイル・スマートフォンで閲覧のお客様はPC版よりサイズ表をご確認頂けます。<BR>*プルダウンメニューにないサイズはご注文できません。<br><div style="margin:10px 0;"><img src="http://image.rakuten.co.jp/acomes/cabinet/parts/nocopyproduct.jpg" width="290px"></div><table width="600" border="0" align="left" cellpadding="2" cellspacing="8">
  <tr>
    <td align="center"><font size="-1"><b>↓ご注文の前にご確認ください↓</b></font>
    </td>
  </tr>
  <tr>
    <td align="left"><font size="-1">■お客様のブラウザ環境によって、表示価格等が最新のものでない場合があります。<br>
      ページの再読み込みなど、ブラウザキャッシュを更新の上、最新の状態で閲覧して頂くようお願いいたします。</font>
    </td>
  </tr>
  <tr>
    <td align="left"><font size="-1">■当店取り扱いのコスチュームは基本的に海外製となっておりますため、サイズ表記は日本製と異なることをご了承ください。また説明書など表記は全て英語となっておりますので、不明な点はお気軽にお問合せください。</font>
    </td>
  </tr>
  <tr>
    <td align="left"><font size="-1">■<b>「あす楽」</b>表記の商品に関しましては13:00までの注文で<br>翌営業日のお届け</b>となります。13:00以降の注文や休業中(土日祝)の注文に関してましても、翌々営業日にお届けさせていただきます。それ以外の通常商品はお届け予定日をご参照ください。</font>
    </td>
  </tr>
　<tr>
    <td align="left"><font size="-1">■含まれるものに記載されていないものに関しては、画像に写っていても含まれないことをご了承ください。</font>
    </td>
  </tr>
　<tr>
    <td align="left"><font size="-1" >■<b>お急ぎ便</b>は、注文画面(カート)の「お支払い方法を選択」画面内「配送方法を選択」にてお選びいただけます。</font>
    </td>
  </tr>
  <tr>
    <td align="left"><font size="-1">■「～日に届きますか」といったお問い合わせを頂戴しますが、<font color="red"><b>正確なお届け日</b></font>につきましては、航空貨物便搭載時に配信されるメールにてお知らせいたしますお荷物追跡番号にてご確認いただくようお願い申し上げます。</font>
    </td>
  </tr>
　<tr>
    <td align="left"><font size="-1"><b>■本商品はご注文タイミングやご注文内容によっては、購入履歴からのご注文キャンセル、修正を受け付けることができない場合がございます。</b></font>
    </td>
  </tr>
  <tr>
    <td align="left"><font size="-1" color="red"><b>■キャンセル規約、または返品・交換についてはこちらをご確認ください</b></font><br>
    <font size="-1">商品管理には十分留意しておりますが、万が一不良品であった場合、またはご注文の商品と違う場合、商品到着後2日以内に当店までご連絡をお願いします。当店にて確認後、良品または正品と交換させていただきます。<br>
注：ご注文の変更・お取り消し(キャンセル)等は、お客様からのご注文後、弊社より「ご注文を承りました」という件名のご注文受付確認メール送信前までとさせていただいております。<br>
注：「サイズの不一致による交換」、「思っていたイメージと異なる」、「使用日に間に合わない」、「間違えて注文してしまった」など、お客様のご都合を理由としたCancel、返品・交換は、受付けておりませんことをご了承願います</font>
    </td>
  </tr>
 <tr>
